package com.evergent.corejava.gneralprogramming;

public class Nloop5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=1;
		for(int i=1;i<=5;i++)
		{
			System.out.println();
			for(int j=1;j<=5;j++)
			{
				System.out.print(" "+a);
				a++;
				
			}
		}

	}

}
